contracts/Guard.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/ReentrancyGuard.sol";

/// @notice Interface for Vault (used for withdrawals)
interface IVault {
    function withdraw(address user, uint256 amount) external;
}

/// @notice Interface for Oracle (must now include getLastUpdate())
interface IOracle {
    function getOracleData() external view returns (uint256, uint256, uint256);
    function getLastUpdate() external view returns (uint256); // <-- NEW function for compatibility
}

/// @title Guard Contract to Monitor and Enforce Secure Withdrawals
/// @notice Interacts with Oracle and Vault to allow or block withdrawals based on threat level
contract Guard is Ownable, ReentrancyGuard {
    IVault public vault;
    IOracle public oracle;

    uint256 public withdrawThreshold;
    bool private _paused;

    event Paused();
    event Unpaused();
    event WithdrawThresholdUpdated(uint256 oldThreshold, uint256 newThreshold);
    event WithdrawalAttempt(address indexed user, uint256 amount, bool allowed);

    error ExceedsThreshold(uint256 requested, uint256 max);
    error PausedError();

    modifier notPaused() {
        if (_paused) revert PausedError();
        _;
    }

    struct WithdrawalAttemptData {
        address user;
        uint256 amount;
        bool allowed;
    }

    WithdrawalAttemptData[] public withdrawalAttempts;

    constructor(address _vault, uint256 _withdrawThreshold, address _oracle) Ownable(msg.sender) {
        require(_vault != address(0), "Guard: zero vault address");
        require(_oracle != address(0), "Guard: zero oracle address");

        vault = IVault(_vault);
        withdrawThreshold = _withdrawThreshold;
        oracle = IOracle(_oracle);
        _paused = false;
    }

    function paused() public view returns (bool) {
        return _paused;
    }

    function getWithdrawalAttemptsCount() external view returns (uint256) {
        return withdrawalAttempts.length;
    }

    function getWithdrawalAttempt(uint256 index) external view returns (address user, uint256 amount, bool allowed) {
        WithdrawalAttemptData storage attempt = withdrawalAttempts[index];
        return (attempt.user, attempt.amount, attempt.allowed);
    }

    function pauseVault(bool pause) public onlyOwner {
        _paused = pause;
        if (pause) {
            emit Paused();
        } else {
            emit Unpaused();
        }
    }

    function unpause() public onlyOwner {
        _paused = false;
        emit Unpaused();
    }

    function setWithdrawThreshold(uint256 _withdrawThreshold) external onlyOwner {
        emit WithdrawThresholdUpdated(withdrawThreshold, _withdrawThreshold);
        withdrawThreshold = _withdrawThreshold;
    }

    function guardedWithdraw(uint256 amount) external notPaused nonReentrant {
        bool allowed = amount <= withdrawThreshold;
        withdrawalAttempts.push(WithdrawalAttemptData(msg.sender, amount, allowed));
        emit WithdrawalAttempt(msg.sender, amount, allowed);
        if (!allowed) revert ExceedsThreshold(amount, withdrawThreshold);
        vault.withdraw(msg.sender, amount);
    }

    function withdrawFromVault(address user, uint256 amount) external onlyOwner {
        vault.withdraw(user, amount);
    }

    /// @notice Checks if alertLevel from Oracle is > 2 (Critical or High)
    function isThreatDetected() public view returns (bool) {
        (, , uint256 alertLevel) = oracle.getOracleData();
        return alertLevel > 2;
    }

    /// @notice Returns all recorded withdrawal attempts
    function getWithdrawalAttempts() external view returns (WithdrawalAttemptData[] memory) {
        return withdrawalAttempts;
    }

    /// @notice Optional: Exposes Oracle's last update timestamp via Guard
    function getOracleLastUpdate() public view returns (uint256) {
        return oracle.getLastUpdate();
    }
}

contracts/Oracle.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

/// @title Oracle Contract for AI-based DeFi Security Monitoring
/// @notice Stores and updates metrics like txFrequency, poolDepth, and alertLevel from backend
contract Oracle {
    /// @notice Address allowed to update oracle data (AI backend or owner)
    address public updater;

    /// @notice Frequency of transactions (could represent suspicious spikes)
    uint256 public txFrequency;

    /// @notice Liquidity pool depth (used to detect sudden drains)
    uint256 public poolDepth;

    /// @notice Alert level set by AI (0: Low, 1: Medium, 2: High, 3: Critical)
    uint256 public alertLevel;

    /// @notice Last update timestamp
    uint256 public lastUpdated;

    /// @notice Emitted when oracle data is updated
    event OracleUpdated(uint256 txFrequency, uint256 poolDepth, uint256 alertLevel);

    /// @dev Constructor sets deployer as updater
    constructor() {
        updater = msg.sender;
    }

    /// @notice Restricts function to the current updater only
    modifier onlyUpdater() {
        require(msg.sender == updater, "Not authorized");
        _;
    }

    /// @notice Update oracle data; can only be called by the updater
    /// @param _txFrequency Number of suspicious txs
    /// @param _poolDepth Remaining pool liquidity
    /// @param _alertLevel Alert level (0–3)
    function updateOracleData(
        uint256 _txFrequency,
        uint256 _poolDepth,
        uint256 _alertLevel
    ) public onlyUpdater {
        txFrequency = _txFrequency;
        poolDepth = _poolDepth;
        alertLevel = _alertLevel;
        lastUpdated = block.timestamp;

        emit OracleUpdated(_txFrequency, _poolDepth, _alertLevel);
    }

    /// @notice Getter to fetch oracle data from frontend or contract
    function getOracleData()
        public
        view
        returns (uint256, uint256, uint256)
    {
        return (txFrequency, poolDepth, alertLevel);
    }

    /// @notice Get the last timestamp when oracle data was updated
    function getLastUpdate() public view returns (uint256) {
        return lastUpdated;
    }

    /// @notice Change the updater address
    /// @param _newUpdater New updater address
    function setUpdater(address _newUpdater) public onlyUpdater {
        updater = _newUpdater;
    }
}

